import React from 'react';
import heart from './heart.svg';
import {Card} from 'bootstrap';

const card = (props) => 
{
    return(
        <Card className="Card">
            <Card.Title><img className="heart" src={heart}/>{props.title}</Card.Title>
            <Card.Text>{props.text}</Card.Text>
        </Card>
    )
}

export default card;
